    protected void Page_Load(object sender, EventArgs e)
    {
        //判断是否登录
        if (!mym.IsAdminLogin())
        {
            Response.Write("<script>parent.location.href='../index.aspx'</script>");
            Response.End();
        }
        //判断权限
        ps_manager_role_value myrv = new ps_manager_role_value();
        int role_id = Convert.ToInt32(Session["RoleID"]);
        int nav_id = 42;
        if (!myrv.QXExists(role_id, nav_id))
        {
            Response.Redirect("../error.html");
            Response.End();
        }
        string _action = AXRequest.GetQueryString("action");
        this.page = AXRequest.GetQueryInt("page", 1);
        if (!string.IsNullOrEmpty(_action) && _action == "Edit")
        {
            this.action = "Edit";//修改类型
            this.rfqnum = Request.QueryString["rfqnum"];
            this.vendorid = Request.QueryString["vendorid"];
            if (!int.TryParse(Request.QueryString["id"] as string, out this.id))
            {
                mym.JscriptMsg(this.Page, "传输参数不正确！", "back", "Error");
                return;
            }

        }
        if (!Page.IsPostBack)
        {
            if (action == "Edit") //修改
            {
                if (this.rfqnum != "")
                {
                    (new EpicorRequest()).GetEpicorRFQVendPrice(this.rfqnum, this.vendorid);
                    (new EpicorRequest()).GetEpicorRFQRFQANS(this.rfqnum, this.vendorid);
                    modelRFQHead = modelRFQHead.GetModelByRFQNum(this.rfqnum);
                    if (modelRFQHead == null)
                        (new EpicorRequest()).GetEpicorRFQRFHead();
                    modelRFQHead = modelRFQHead.GetModelByRFQNum(this.rfqnum);
                }
                ShowInfo(this.rfqnum,this.vendorid);
                ShowEpicorAttachment(this.rfqnum);


            }
        }
    }


