    private void ShowEpicorAttachment(string _rfqnum)
    {
        string[] XFileArr =  (new EpicorRequest()).GetEpicorRFQAttachment(_rfqnum);
        btnEpicorAttachmentDownload1.Visible = lbEpicorAttachment1.Visible = false;
        btnEpicorAttachmentDownload2.Visible = lbEpicorAttachment2.Visible = false;
        btnEpicorAttachmentDownload3.Visible = lbEpicorAttachment3.Visible = false;
        if (XFileArr != null && XFileArr.Length > 0)
        {
            for (int i = 0; i < XFileArr.Length; i++)
            {
                if (i == 0)
                {
                    btnEpicorAttachmentDownload1.Visible = lbEpicorAttachment1.Visible = true;
                    string[] XFileInfoArr = Regex.Split(XFileArr[i], "vvvvvvvvvv", RegexOptions.IgnoreCase);
                    string[] XFileInfoName = Regex.Split(XFileInfoArr[2], "\\\\", RegexOptions.IgnoreCase);
                    lbEpicorAttachment1.Text = XFileInfoName[XFileInfoName.Length - 1];
                    hdEpicorAttachment1.Value = XFileInfoArr[1];
                }
                if (i == 1)
                {
                    btnEpicorAttachmentDownload2.Visible = lbEpicorAttachment2.Visible = true;
                    string[] XFileInfoArr = Regex.Split(XFileArr[i], "vvvvvvvvvv", RegexOptions.IgnoreCase);
                    string[] XFileInfoName = Regex.Split(XFileInfoArr[2], "\\\\", RegexOptions.IgnoreCase);
                    lbEpicorAttachment2.Text = XFileInfoName[XFileInfoName.Length - 1];
                    hdEpicorAttachment2.Value = XFileInfoArr[1];
                }
                if (i == 2)
                {
                    btnEpicorAttachmentDownload3.Visible = lbEpicorAttachment3.Visible = true;
                    string[] XFileInfoArr = Regex.Split(XFileArr[i], "vvvvvvvvvv", RegexOptions.IgnoreCase);
                    string[] XFileInfoName = Regex.Split(XFileInfoArr[2], "\\\\", RegexOptions.IgnoreCase);
                    lbEpicorAttachment2.Text = XFileInfoName[XFileInfoName.Length - 1];
                    hdEpicorAttachment3.Value = XFileInfoArr[1];
                }
            }
        }


    }
