    private void RptVendorPriceBind(string _strWhere, string _orderby)
    {
        this.page = AXRequest.GetQueryInt("page", 1);


        int totalCount = 0;
        ps_epicor_rfq_vendorprice bll = new ps_epicor_rfq_vendorprice();
        DataSet dsVendorPrice = bll.GetList2(100, this.page, _strWhere, _orderby, out totalCount);
        this.rptVendorPriceList.DataSource = dsVendorPrice;
        this.rptVendorPriceList.DataBind();
        this.lbUnitPriceCurrency.Text = this.lbAmountCurrency.Text = (dsVendorPrice != null && dsVendorPrice.Tables[0].Rows.Count > 0) ? dsVendorPrice.Tables[0].Rows[0]["UD37_RFQVP_CurrencyCode_c"].ToString() : "";
    }
    
