    #region 组合SQL查询语句==========================
    protected string CombSqlTxt(string _rfqnum)
    {
        StringBuilder strTemp = new StringBuilder();
        if (_rfqnum !="")
        {
            strTemp.Append("  UD34_Key1=" + _rfqnum);
        }

        return strTemp.ToString();
    }

    protected string CombSqlTxt2(string _rfqnum, string _vendorid)
    {
        StringBuilder strTemp = new StringBuilder();
        if (_rfqnum != "")
        {
            strTemp.Append("  UD37_Key1=" + _rfqnum + " and UD37_RFQVP_VendorID_c ='" +_vendorid + "'");
        }

        return strTemp.ToString();
    }
    #endregion

    #region 修改操作=================================
    private bool DoEdit(int _id)
    {
        DateTime now = DateTime.Now;
        string note_no = now.ToString("yy") + now.ToString("MM") + now.ToString("dd") + now.ToString("HH") + now.ToString("mm") + now.ToString("ss");

        bool result = false;
        ps_here_depot model = new ps_here_depot();
        model.GetModel(_id);
       

        #region file1 upload

        string fileNameDesign = FileReplyRFQ1.FileName;//获取要导入的文件名 
        if (fileNameDesign != null && fileNameDesign != "")
        {
            string savePath = Server.MapPath("~/upload/files/");
            string formatdate = DateTime.Now.ToString("yyyyMMddHHmmssfff");
            FileOperatpr(fileNameDesign, savePath);
            string url = savePath + formatdate + "-" + fileNameDesign;
            txtReplyRFQ1Name.Value = formatdate + "-" + fileNameDesign;


            FileReplyRFQ1.SaveAs(url);
        }
        #endregion

        #region file2 upload

        string fileNameDesign2 = FileReplyRFQ1.FileName;//获取要导入的文件名 
        if (fileNameDesign2 != null && fileNameDesign2 != "")
        {
            string savePath = Server.MapPath("~/upload/files/");
            string formatdate = DateTime.Now.ToString("yyyyMMddHHmmssfff");
            FileOperatpr(fileNameDesign2, savePath);
            string url = savePath + formatdate + "-" + fileNameDesign2;
            txtReplyRFQ2Name.Value = formatdate + "-" + fileNameDesign2;


            FileReplyRFQ2.SaveAs(url);
        }
        #endregion

        #region file3 upload

        string fileNameDesign3 = FileReplyRFQ1.FileName;//获取要导入的文件名 
        if (fileNameDesign3 != null && fileNameDesign3 != "")
        {
            string savePath = Server.MapPath("~/upload/files/");
            string formatdate = DateTime.Now.ToString("yyyyMMddHHmmssfff");
            FileOperatpr(fileNameDesign3, savePath);
            string url = savePath + formatdate + "-" + fileNameDesign3;
            txtReplyRFQ3Name.Value = formatdate + "-" + fileNameDesign3;


            FileReplyRFQ3.SaveAs(url);
        }
        #endregion

        ps_join_depot model1 = new ps_join_depot();
        model1.product_category_id = model.product_category_id;
        model1.note_no = note_no;
        model1.add_time = DateTime.Now;
        model1.product_name = model.product_name;
        model1.product_code_state = "入库";
        model1.go_price = model.go_price;
        model1.salse_price = model.salse_price;
        model1.user_id = Convert.ToInt32(Session["AID"]);
        //model1.product_num = int.Parse(txtproduct_num.Text);
        model1.here_depot_id = _id;
        model1.dw = model.dw;
        model1.Add();

        if (model.UpdateALL())
        {
            //mym.AddAdminLog("入库", "入库商品:" + txtproduct_name.Text); //记录日志
            result = true;
        }

        return result;
    }
    #endregion


    protected void btnUpdateQuestion_Click(object sender, EventArgs e)
    {
        DateTime now = DateTime.Now;
        string QuestionID = ((Button)sender).CommandArgument;
        ps_here_depot blldepot = new ps_here_depot();
        ps_epicor_rfq_ans bllEpicorAnswer = new ps_epicor_rfq_ans();
        foreach (RepeaterItem rptitem in this.rptList.Items)
        {
            HiddenField hdID = rptitem.FindControl("hdID") as HiddenField;
            HiddenField hdSeq = rptitem.FindControl("hdSeq") as HiddenField;
            if (hdID.Value == QuestionID)
            {
                bllEpicorAnswer = bllEpicorAnswer.GetModel(Convert.ToInt32(QuestionID));
                TextBox txtRFQQNAAnswer = rptitem.FindControl("txtRFQQNAAnswer") as TextBox;
                bllEpicorAnswer.UD34_RFQQNA_Answer_c = txtRFQQNAAnswer.Text.Trim();
                bllEpicorAnswer.Update(bllEpicorAnswer);
                //mym.JscriptMsg(this.Page, "Update Success！", "back", "Success");
                (new ps_manager_log()).AddLog(Session["AID"].ToString(), Session["AdminName"].ToString(), "RFQ", "Update Answer.RFQNumber:" + this.rfqnum + ".Vendor:" + this.vendorid + ".Sequence:" + hdSeq.Value, AXRequest.GetIP());
                ScriptManager.RegisterStartupScript(this, typeof(string), "Success", "$.dialog.success( 'Answer Updated！');", true);
            }
        }

    }

    protected void btnUpdateVendorPrice_Click(object sender, EventArgs e)
    {
        DateTime now = DateTime.Now;
        string VendorPriceID = ((Button)sender).CommandArgument;
        ps_epicor_rfq_vendorprice bllVendorPrice = new ps_epicor_rfq_vendorprice();
        foreach (RepeaterItem rptitem in this.rptVendorPriceList.Items)
        {
            HiddenField hdID = rptitem.FindControl("hdID") as HiddenField;
            HiddenField hdSeq = rptitem.FindControl("hdSeq") as HiddenField;
            if (hdID.Value == VendorPriceID)
            {
                bllVendorPrice = bllVendorPrice.GetModel(Convert.ToInt32(VendorPriceID));
                TextBox txtUnitPrice = rptitem.FindControl("txtUnitPrice") as TextBox;
                TextBox txtRemark = rptitem.FindControl("txtRemark") as TextBox;
                bllVendorPrice.UD37_RFQVP_OfferedPrice_c = AesEncryption.Encrypt(txtUnitPrice.Text.Trim());
                bllVendorPrice.UD37_RFQVP_Remark_c = txtRemark.Text.Trim();
                bllVendorPrice.Update(bllVendorPrice);
                //mym.JscriptMsg(this.Page, "Update Success！", "back", "Success");
                (new ps_manager_log()).AddLog(Session["AID"].ToString(), Session["AdminName"].ToString(), "RFQ", "Update Price.RFQNumber:" + this.rfqnum + ".Vendor:" + this.vendorid + ".Line:" + hdSeq.Value, AXRequest.GetIP());
                ScriptManager.RegisterStartupScript(this, typeof(string), "Success", "$.dialog.success( 'Price Updated！');", true); 
            }
        }

    }


