    protected void btnSave_Click(object sender, EventArgs e)
    {
        modelRFQHead = modelRFQHead.GetModelByRFQNum(this.rfqnum);
        modelRFQHead.AddRFQAttachment(this.rfqnum, this.vendorid);

        //对上传文件的大小进行检测，限定文件最大不超过50M
