    //小数位是0的不显示
    public string MyConvert(object d)
    {
        string myNum = d.ToString();
        string[] strs = d.ToString().Split('.');
        if (strs.Length > 1)
        {
            if (Convert.ToInt32(strs[1]) == 0)
            {
                myNum = strs[0];
            }
        }
        return myNum;
    }

    //负数红色显示
    public string MyZF(object d)
    {
        string myNum = d.ToString();
        if (Convert.ToInt32(d.ToString()) <= 0)
        {
            myNum = "<font color=red> " + d.ToString() + "</font>";
        }
        return myNum;
    }

    #region 辅助功能

    private void SetTextBoxesReadOnly(bool isReadOnly)
    {
        foreach (Control ctrl in this.Controls)
        {
            if (ctrl is TextBox)
            {
                ((TextBox)ctrl).ReadOnly = isReadOnly;
            }
        }
    }
    /// <summary>
    /// 获取上传文件的后缀名
    /// </summary>
    /// <param name="fileName"></param>
    /// <returns></returns>
    private string getFileEND(string fileName)
    {
        if (fileName.IndexOf(".") == -1)
            return "";
        string[] temp = fileName.Split('.');
        return temp[temp.Length - 1].ToLower();
    }
    /// <summary>
    /// //获取上传文件的名称
    /// </summary>
    /// <param name="fileName"></param>
    /// <returns></returns>
    private string getFileExt(string fileName)
    {
        if (fileName.IndexOf(".") == -1)
            return "";
        string file = "";
        string[] temp = fileName.Split(new[] { "." }, StringSplitOptions.RemoveEmptyEntries);
        file = temp[0].ToLower();
        return file.ToLower();
    }


    private void FileOperatpr(string fileName, string savePath)
    {
        if (!Directory.Exists(savePath))
        {
            Directory.CreateDirectory(savePath);
        }
        if (File.Exists(savePath + fileName))
        {
            File.Delete(savePath + fileName);
        }
    }

    private string randomNum()
    {
        Random rm = new Random();
        string returnValue = "";
        for (int i = 0; i < 4; i++)
        {
            int k = rm.Next();

            char j = (char)('0' + (char)(k % 10));

            returnValue += j.ToString();
        }

        return AesEncryption.Encrypt(returnValue);
    }

